// StudentList.js
import React from 'react';

function StudentList({ students, onSelect }) {
  return (
    <div>
      <h3>Student List</h3>
      <ul>
        {students.map((student) => (
          <li key={student.id}>
            {student.name}
            <button onClick={() => onSelect(student.id)}>Select</button>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default StudentList;
